import React from 'react';
import { StyleSheet, View, Button, Text, Dimensions, TextInput, Picker ,TouchableOpacity} from 'react-native';
import { useState, useEffect } from 'react';
import {createProduct} from '../axios/accessServer';

const AddProduct = ({ route, ...props }) => {
    const deviceWidth = Math.round(Dimensions.get('window').width);
    const deviceHeight = Math.round(Dimensions.get('window').height);

    const [productName, setProductName] = useState('');
    const [quantity, setQuantity] = useState('');
    const [unit, setUnit] = useState('');
    const [expirationDate, setExpirationDate] = useState('');
    const [deliveryDate, setDeliveryDate] = useState('');
    const [brand, setBrand] = useState('');


    const [isChecked, setIsChecked] = useState(false);
    const [alertValue, setAlertValue] = useState('');
    //===========================================================
    const sendData = async ()=>{
        let json = {
            Inventoryid: route.params.Inventoryid,
            productName: productName,
            quantity: quantity,
            brand: brand,
            unit: unit,
            expirationDate: expirationDate,
            deliveryDate: deliveryDate,
            isChecked: isChecked,
            alertValue: alertValue

        };
        await createProduct(json);
    }
//================================================
    return (
        <View style={styles.container}>

            <Text style={styles.tytle}>Add a product</Text>

            <View style={styles.line}>
                <Row label="Product Name:" margin={10}>
                    <TextInput style={styles.input} onChangeText={text => setProductName(text)} />
                </Row>
                <Row label="Quantity:" margin={10}>
                    <TextInput style={styles.input} onChangeText={text => setQuantity(text)} />
                </Row>
            </View>

            <View style={styles.line}>
                <Row label="Unit:" margin={10}>
                    <TextInput style={styles.input} onChangeText={text => setUnit(text)} />
                </Row>
                <Row label="Expiration Date:" margin={10}>
                    <TextInput style={styles.input} onChangeText={text => setExpirationDate(text)} />
                </Row>
            </View>
            
            <View style={styles.line}>
                <Row label="Delivery Date:" margin={10}>
                    <TextInput style={styles.input} onChangeText={text => setDeliveryDate(text)} />
                </Row>
                <Row label="Alert when below:" margin={10}>
                    <TextInput
                        style={styles.input}
                        value={alertValue}
                        onChangeText={text => setAlertValue(text)}
                    />
                </Row>
            </View>
            <View style={styles.line}>
                <Row label="Brand:" margin={10}>
                    <TextInput style={styles.input} onChangeText={text => setBrand(text)} />
                </Row>
            </View>
            
            <TouchableOpacity
            style={styles.button}
            onPress={() => navigation.navigate("Inventory", sendData())}
        >
            <Text style={styles.buttonText}>Add Product</Text>
        </TouchableOpacity>
        </View>
    );
}

const Row = ({ label, children, margin }) => (
    <View style={[styles.row, { marginVertical: margin }]}>
      <Text style={styles.label}>{label}</Text>
      <View style={{ marginLeft: margin }}>{children}</View>
    </View>
  );



const styles = StyleSheet.create({
    container: {
        backgroundColor: '#FFFFFF',
        borderRadius: 15,
        shadowRadius: 30,
        flexDirection: 'column',
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
        
    },
    tytle:{
        textAlign: 'center',
        fontWeight: 'bold',
        fontSize: 23,
    },
    row: {
        flexDirection: 'column',
        justifyContent: 'space-between',
        marginBottom: 10,
    },
    label: {
        fontSize: 14,
        fontWeight: 'bold',
        marginRight: 10,
        fontFamily: 'GeneralSans-Semibold',
    },
    input: {
        flex: 1,
        borderWidth: 1,
        borderColor: '#000000',
        borderRadius: 5,
        paddingHorizontal: 10,
        paddingVertical: 5,
        marginRight: 10, // רווח מימין בין האינפוטים בשורה

    },
    line: {
        flexDirection: 'row',
        justifyContent: 'space-between',
        marginBottom: 5,
    },
    
    button: {
        backgroundColor: '#121A29',
        padding: 10,
        borderRadius: 5,
        alignItems: 'center',
        justifyContent: 'center',
        width: '80%',
      },
      buttonText: {
        color: '#FFFFFF',
        fontSize: 16,
      },
});

export default AddProduct;
